import React, { useState, useEffect } from "react";
import axios from "axios";
import { VerticalGraph } from "./VerticalGraph";

const API = process.env.REACT_APP_API_URL;

const Holdings = () => {
  const [allHoldings, setAllHoldings] = useState([]);

  useEffect(() => {
    axios
      .get(`${API}/api/holdings`)
      .then((res) => {
        setAllHoldings(res.data || []);
      })
      .catch((err) => {
        console.error("Holdings API error:", err);
      });
  }, []);

  /* ================= GRAPH DATA ================= */
  const data = {
    labels: allHoldings.map((stock) => stock.instrument),
    datasets: [
      {
        label: "Stock Price",
        data: allHoldings.map((stock) => stock.ltp ?? 0),
        backgroundColor: "rgba(65, 132, 243, 0.6)",
      },
    ],
  };

  return (
    <>
      {/* ================= HOLDINGS TABLE ================= */}
      <div className="holdings-container">
        <h3 className="title">Holdings ({allHoldings.length})</h3>

        <div className="order-table">
          <table>
            <thead>
              <tr>
                <th>Instrument</th>
                <th>Qty.</th>
                <th>Avg. cost</th>
                <th>LTP</th>
                <th>Cur. val</th>
                <th>P&amp;L</th>
              </tr>
            </thead>

            <tbody>
              {allHoldings.map((stock) => {
                const qty = stock.qty ?? 0;
                const avgCost = stock.avgCost ?? 0;
                const ltp = stock.ltp ?? 0;

                const curValue = ltp * qty;
                const pnl = curValue - avgCost * qty;
                const profClass = pnl >= 0 ? "profit" : "loss";

                return (
                  <tr key={stock._id}>
                    <td>{stock.instrument}</td>
                    <td>{qty}</td>
                    <td>{avgCost.toFixed(2)}</td>
                    <td>{ltp.toFixed(2)}</td>
                    <td>{curValue.toFixed(2)}</td>
                    <td className={profClass}>{pnl.toFixed(2)}</td>
                  </tr>
                );
              })}
            </tbody>
          </table>
        </div>
      </div>

      {/* ================= SUMMARY (STATIC FOR NOW) ================= */}
      <div className="holdings-summary">
        <div className="row text-center">
          <div className="col">
            <h5>
              29,875.<span>55</span>
            </h5>
            <p>Total investment</p>
          </div>

          <div className="col">
            <h5>
              31,428.<span>95</span>
            </h5>
            <p>Current value</p>
          </div>

          <div className="col">
            <h5 className="profit">1,553.40 (+5.20%)</h5>
            <p>P&amp;L</p>
          </div>
        </div>
      </div>

      {/* ================= GRAPH ================= */}
      <div className="holdings-container">
        <VerticalGraph data={data} />
      </div>
    </>
  );
};

export default Holdings;
